import React from 'react';
import Hero from './Hero';
import Team from './Team';
import NavBar from '../NavBar';
import Footer from '../Footer';

function AboutPage() {
    return ( 
        <>
        <NavBar />
        <Hero />
        <Team />
        <Footer />
        </>
     );
}

export default AboutPage;
